import React, { Component } from "react";
import MyComponent from "./MyComponent";

class App extends Component {
  constructor(props) {
    super(props);

    this.state = { counter: 1 };
  }

  incrementCounter() {
    this.setState = { counter: this.state.counter + 1};
  }

  render() {
    return (
      <div>
        <MyComponent />
      </div>
    );
  }
}

export default App;
